import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav className="bg-blue-500 p-4">
      <ul className="flex space-x-4">
        <li><Link to="/" className="text-white">Home</Link></li>
        <li><Link to="/about-us" className="text-white">About Us</Link></li>
        <li><Link to="/programs" className="text-white">Programs</Link></li>
        <li><Link to="/gallery" className="text-white">Gallery</Link></li>
        <li><Link to="/join-us" className="text-white">Join Us</Link></li>
        <li><Link to="/book-tour" className="text-white">Book a Tour</Link></li>
        <li><Link to="/registration" className="text-white">Registration</Link></li>
        <li><Link to="/fees" className="text-white">Fees</Link></li>
        <li><Link to="/news" className="text-white">News</Link></li>
      </ul>
    </nav>
  );
}

export default Navbar;
